import './PokeCard.css';

function PokeCard() {
  
  class Pokemon {
    elementTypes ='fire';
    name ='Ronaldo';
    id ='30';
    ClassNames ='card';
    CardSubtitle= 'Plant|Poisonous';

  }


  
  const image = () =>
  {return `https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/${pokemon.id}.png` }
  

  return (
    <li className='card ice'>
        <img class="card-image "alt = {pokemon.name} src= {image()} />
        <h2 class="card-title"> {pokemon.id}. {pokemon.name}</h2>
        <p class="card-subtitle">{pokemon.CardSubtitle}</p>
    </li>
  );
}

export default PokeCard;
